import { useState } from "react";

const Homepage = () => {
    const name = useState("Jas");

    const handleClick = (e) => {
        name = "Eve"
    }

    return ( 
        <>
           <div className="home">
            <h2>Home Page</h2>
            <button onClick={handleClick}>Click</button>
           </div>
        </> 
    );
}
 
export default Homepage;
